import { RouterProvider, createBrowserRouter } from 'react-router-dom';

import Movies from './Movies';
import MyMovies from './MyMovies';
import Navigation from './Navigation';
import LoginForm from './LoginForm';
import CategoryMovies from './CategoryMovies';
import MovieItem from './MovieItem';
import RegisterForm from './RegisterForm';
import CreateMovie from './CreateMovie';
import EditForm from './EditForm';
import DeleteMovie from './DeleteMovie';
import Page404 from './Page404';
import Footer from './Footer';

import MoviesList from './admin/MoviesList';
import CreateMovieAdmin from './admin/CreateMovie';
import EditMovieAdmin from './admin/EditMovie';
import DeleteMovieAdmin from './admin/DeleteMovie';
import CategoriesList from './admin/CategoriesList';
import CreateCategory from './admin/CreateCategory';
import EditCategory from './admin/EditCategory';
import DeleteCategory from './admin/DeleteCategory';
import UsersList from './admin/UsersList';
import AddUser from './admin/AddUser';
import EditUser from './admin/EditUser';
import DeleteUser from './admin/DeleteUser';

import './css/style.css';

export default function App() {

    const routes = createBrowserRouter([
        {
            path: "/",
            element: <Navigation />,
            errorElement: <Page404 />,
            children: [
                {
                    path: 'register',
                    element: <RegisterForm />
                },
                {
                    path: 'login',
                    element: <LoginForm />
                },
                {
                    path: 'movies',
                    element: <Movies />
                },
                {
                    path: '/',
                    element: <Movies />
                },
                {
                    path: 'movies/my',
                    element: <MyMovies />
                },
                {
                    path: 'movies/category/:catId?',
                    element: <CategoryMovies />
                },
                {
                    path: 'movies/:movieId?',
                    element: <MovieItem />
                },
                {
                    path: 'movies/create',
                    element: <CreateMovie />
                },
                {
                    path: 'movies/:movieId/edit',
                    element: <EditForm />
                },
                {
                    path: 'movies/:movieId/delete',
                    element: <DeleteMovie />
                },
                {
                    path: 'admin/movies',
                    element: <MoviesList />
                },
                {
                    path: 'admin/movies/create',
                    element: <CreateMovieAdmin />
                },
                {
                    path: 'admin/movies/:movieId/edit',
                    element: <EditMovieAdmin />
                },
                {
                    path: 'admin/movies/:movieId/delete',
                    element: <DeleteMovieAdmin />
                },
                {
                    path: 'admin/categories',
                    element: <CategoriesList />
                },
                {
                    path: 'admin/categories/create',
                    element: <CreateCategory />
                },
                {
                    path: 'admin/categories/:categoryId/edit',
                    element: <EditCategory />
                },
                {
                    path: 'admin/categories/:categoryId/delete',
                    element: <DeleteCategory />
                },
                {
                    path: 'admin/users',
                    element: <UsersList />
                },
                {
                    path: 'admin/users/create',
                    element: <AddUser />
                },
                {
                    path: 'admin/users/:userId/edit',
                    element: <EditUser />
                },
                {
                    path: 'admin/users/:userId/delete',
                    element: <DeleteUser />
                }
            ]
        }
    ]);

    return (
        <>
            <RouterProvider router={routes} />
            <Footer />
        </>
    );
}
